contract Cryptoonia {
    ToonNFT toonNFT;
    ToonCoin toonCoin;
    address payable owner;
    uint256 public NFTprice;
    uint256 public playerCount;
    mapping (address => string) public playerToName;
    mapping (address => uint256) public playerToId;
    mapping (uint256 => address) public playerIdToAddress;
    constructor (address _NFTAddress, address _ToonCoinAddress) {
        toonNFT = ToonNFT(_NFTAddress);
        toonCoin = ToonCoin(_ToonCoinAddress);
        playerCount = 0;
        owner = payable(msg.sender);
    }

    function createPlayer(string memory _name) public returns (uint256) {
        require (playerToId[msg.sender] <= 0, "Player already exists");
        playerCount = playerCount + 1;
        playerToName[msg.sender] = _name;
        playerToId[msg.sender] = playerCount;
        playerIdToAddress[playerCount] = msg.sender;
        return playerCount;
    }

    function setNFTPrice(uint256 _price) public {
        require(msg.sender == owner, "Caller is not the owner.");
        NFTprice = _price;
    }

    function mintNFT(uint256 _winPower) public payable{
        require(playerToId[msg.sender] > 0, "Player doesn't exist.");
        require(msg.value >= NFTprice, "Amount sent less than NFT value.");
        owner.transfer(msg.value);
        toonNFT.createCollectible(_winPower, msg.sender);
    }

    function cashOut(address player, uint256 _winning) public {
        require(msg.sender == owner, "Caller is not the owner.");
        require(playerToId[player] > 0, "Player doesn't exist.");
        toonCoin.transfer(player, _winning);
    }

}
